import {withRouter} from 'react-router-dom';
import {CardElement} from '@stripe/react-stripe-js';

const PaymentForm = () => {
    return(
        <>
            <h1>Washify</h1>

            <form id = "payment-form">
                <label htmlFor = "card-element">Card</label>
                <CardElement />

                <button>Pay</button>

            </form>
        </>
    )
}

export default withRouter(PaymentForm);



